import logo from './logo.svg';
import './App.css';
function App({props}) {
  const {saludo} = {...props};
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to sreload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React {saludo}
        </a>
      </header>
    </div>
  );
}

export default App;
